const formListModule = {
    state: {
        formCurrent: [],
    },

    getters: {
        getFormCurrent(state) {
            return state.formCurrent;
        },
    },
    mutations: {
        SET_ACCOUNT_CURRENT(state, formCurrent) {
            state.formCurrent = formCurrent;
        },
    },
    actions: {},
};
export default formListModule;
